import React from "react";
import "./Splash.css";

class Splash extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { balloonMessage } = this.props;

    return <div className="speech-bubble">{balloonMessage}</div>;
  }
}

export default Splash;
